import React from 'react';


const Contact = () => {
    return (
        <div className="Contact">
                <h1>Contact US</h1>
                <p>If you have a question, comment, or suggestion, please send us an email at:
                    <br />
                    <br />
                    &nbsp;&nbsp;&nbsp;&nbsp;<b><i>fusion.eng.uci@gmail.com</i></b></p>
        </div>
);
}

export default Contact;
